import React, { Component } from 'react'
import {Button} from 'react-bootstrap'

export default class AddProject extends Component {
    render() {
        return (
            <div>
                  <Button onClick={()=>this.props.addProject(false)} variant="primary">  Go Back </Button>
<br />
                adding a project
            </div>
        )
    }
}
